import "./User.css";
function User(props, Children) {
  return (
    <div className="container">
      <p>
        id : {props.id}
        {Children}
      </p>
      <p>name : {props.name}</p>
      <p>age : {props.age}</p>
    </div>
  );
}

export default User;
